from collections import defaultdict
class Solution:
    def countPalindromicSubsequence(self, s: str) -> int:
        hsh = defaultdict(list)
        for i, v in enumerate(s):
            if v not in hsh:
                hsh[v] = [i]
            elif len(hsh[v]) == 1:
                hsh[v] += [i]
            else:
                hsh[v][1] = i
        res = 0
        for k, v in hsh.items():
            if len(v) == 2:
                i, j = v
                res += len(set(s[i+1:j]))
        return res

